import React from "react";
import styles from "./DashboardStyles";

const Dashboard = () => {
  return (
    <div style={styles.container}>
      {/* Sidebar */}
      <div style={styles.sidebar}>
        <h1 style={styles.sidebarTitle}>LOCALSE</h1>
        <div style={styles.menu}>
          <div
            style={styles.menuItem}
            onMouseOver={(e) => (e.target.style.background = styles.menuItemHover.background)}
            onMouseOut={(e) => (e.target.style.background = styles.menuItem.background)}
          >
            Notice
          </div>
          <div
            style={styles.menuItem}
            onMouseOver={(e) => (e.target.style.background = styles.menuItemHover.background)}
            onMouseOut={(e) => (e.target.style.background = styles.menuItem.background)}
          >
            Settings
          </div>
          <div
            style={styles.menuItem}
            onMouseOver={(e) => (e.target.style.background = styles.menuItemHover.background)}
            onMouseOut={(e) => (e.target.style.background = styles.menuItem.background)}
          >
            More
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div style={styles.mainContainer}>
        {/* Header */}
        <div style={styles.header}>
          <span>Employee Name</span>
          <span
            style={styles.logout}
            onMouseOver={(e) => (e.target.style.color = "darkred")}
            onMouseOut={(e) => (e.target.style.color = "red")}
          >
            Logout
          </span>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
